import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import NParksServiceRequest from "../apis/nationalParksApi";
import NavBar from "../NavBar";


const TourDetails = ({token, setToken}) => {

  const { id } = useParams()
  const [data, setData] = useState(null)
  const [centerPosition, setCenterPosition] = useState(null)

  useEffect(() => {
    const getData = async () => {

      const tourData = await NParksServiceRequest.getTourDetails(id)
      console.log(tourData)
      setData(tourData)

      const location = await NParksServiceRequest.getParkLatLong(tourData.park.parkCode)
      // console.log(location)
      setCenterPosition([location.latitude, location.longitude])
    }
    getData()
  }, [])

  return (
    <div id="tour-details-main-container">
      <NavBar
        token={token}
        setToken={setToken}
      />
      <p>Tour Details</p>
    </div>
  )
}

export default TourDetails;
